import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const  Home = () => {
    return(
        <Container>
            <Row>
                <Col sm={12} md={7} lg={5}>1 of 2</Col>
                <Col sm={12} md={7} lg={5}>2 of 2</Col>
            </Row>
        </Container>
    ) 
}

export default Home;
